import React, { useState } from 'react';
import { Helmet } from 'react-helmet';
import { useNavigate } from 'react-router-dom';

function Login() {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const navigate = useNavigate();

    const handleLogin = (e) => {
        e.preventDefault();
        if (email && password) {
            console.log('Logging in with:', { email, password });
            // Add API call logic
            navigate('/dashboard'); // Navigate after successful login
        } else {
            alert('Please fill in all fields');
        }
    };

    return (
        <div>
            <Helmet>
                <link rel="stylesheet" href="assets/bootstrap/css/bootstrap.min.css" />
            </Helmet>
            <nav className="navbar navbar-expand-md sticky-top py-3 navbar-dark" id="mainNav">
                <div className="container">
                    <a className="navbar-brand d-flex align-items-center" href="/">
                        <span className="bs-icon-sm bs-icon-circle bs-icon-primary shadow d-flex justify-content-center align-items-center me-2 bs-icon">
                            {/* SVG Icon */}
                        </span>
                        <span>Brand</span>
                    </a>
                    <div className="collapse navbar-collapse">
                        <ul className="navbar-nav mx-auto">
                            <li className="nav-item">
                                <a className="nav-link active" href="login.html">Log in</a>
                            </li>
                        </ul>
                        <a className="btn btn-primary shadow" href="signup.html">Sign up</a>
                    </div>
                </div>
            </nav>
            <section className="py-5">
                <div className="container py-5">
                    <div className="row mb-4">
                        <div className="col text-center">
                            <h2>Welcome Back</h2>
                        </div>
                    </div>
                    <div className="row justify-content-center">
                        <div className="col-md-6">
                            <form onSubmit={handleLogin}>
                                <div className="mb-3">
                                    <input
                                        type="email"
                                        className="form-control"
                                        placeholder="Email"
                                        value={email}
                                        onChange={(e) => setEmail(e.target.value)}
                                    />
                                </div>
                                <div className="mb-3">
                                    <input
                                        type="password"
                                        className="form-control"
                                        placeholder="Password"
                                        value={password}
                                        onChange={(e) => setPassword(e.target.value)}
                                    />
                                </div>
                                <button type="submit" className="btn btn-primary w-100">Log in</button>
                            </form>
                        </div>
                    </div>
                </div>
            </section>
        </div>
    );
}

export default Login;
